releaseNotes:
New features:
	  - NOTENET-1878 Add support for OneNote Online (SharePoint) file format;
	  - NOTENET-1868 Add table support for OneNote Online documents;
	  - NOTENET-1898 Add support for alternative text in image;
	  - NOTENET-803 Give user an ability to set result image resolution during export to image formats.
Fixed bugs:
	  - NOTENET-533 Not supported file format error when loading OneNote document;
	  - NOTENET-671 Incorrect page manifest and page metadata matching;
	  - NOTENET-1778 Not Supported Exception while loading OneNote files;
	  - NOTENET-1901 Long solid text cannot be saved to OneNote format;
	  - NOTENET-1903 IOE is thrown in case page revision does not have create time property;
	  - NOTENET-1904 Error on save to OneNote format when PageNode does not have last modified time property.
